// Reducer takes two values state and action
export const bankingReducer = (state, action) => {
    return state // return  the old state
}

// actions

// deposit
const deposit = {
    type: "DEPOSIT",
    amount: 20
}

// withdraw
const withdraw = {
    type: "WITHDRAW",
    amount: 30
}

// Collect interest
const collectInterest = {
    type: "COLLECT_INTEREST"
}

// delete account

const deleteAccount = {
    type: "DELETE_ACCOUNT"
}
